/**
 * @param {string} s
 * @param {string} t
 * @return {character}
 */

var findTheDifference = function (s, t) {
    let list = [];
    for (let i = 0; i < s.length; i++) {
        list[s[i]] = 0;
    }
    for (let i = 0; i < t.length; i++) {
        list[t[i]] = 0;
    }

    for (let i = 0; i < s.length; i++) {
        list[s[i]]++;
    }
    for (let i = 0; i < t.length; i++) {
        list[t[i]]++;
    }

    for (let i = 0; i < t.length; i++) {
        if (list[t[i]] % 2) {
            return t[i];
        }
    }
};


// alert(findTheDifference("", ""));
alert(findTheDifference("abcd", "abcde"));
